        W1(\x) = (3*rad(-atan(exp(2*(\x-3))))+3*pi/2)/2; %%%% Function W1
        W2(\x) = 3*rad(atan(exp(-2*(\x+3))))/2; %%%% Function W2
        P(\x) = (W1(\x)-W2(\x))*9/10; %%%% Function W2
      }]

    %%%%%%%%% Axis of coordinates
    \draw[->] (-6.5,0) -- (6.5,0);
    \draw[->] (0,-0.3) -- (0,3);

    %%%%%%%% The two solitary waves
    \draw (3.7,1.5) node {$R_1$};
    \draw [domain=-6.5:6.5, samples=\Numbis] plot(\x,{R1(\x)});
    \draw (-2.2,1.2) node {$R_2$};
    \draw [domain=-6.5:6.5, samples=\Numbis] plot(\x,{R2(\x)});

    \draw (-4.2,1.9) node {$W_2$};
    \draw [domain=-6.5:6.5, samples=\Numbis,color=red] plot(\x,{W2(\x)});
    \draw (2.3,2.5) node {$W_1$};
    \draw [domain=-6.5:6.5, samples=\Numbis,color=red] plot(\x,{W1(\x)});
    \draw (0.5,1.8) node {$P$};
    \draw [domain=-6.5:6.5, samples=\Numbis,color=blue] plot(\x,{P(\x)});
\end{tikzpicture}

\end{document}

